import React, { Component } from "react";

class Like extends Component {
  render() {
    let { movie, onLike } = this.props;
    if (movie.liked) return <i className="fa fa-heart"></i>;
    return <i className="fa fa-heart-o" onClick={() => onLike(movie)}></i>;
  }
}

export default Like;
